export const styles = ({ spacing, palette }) => ({
    root: { marginLeft: spacing(1) * -1 },
    rootInverted: {
        color: `${palette.white.main} !important`,
    },
    checkbox: { padding: spacing(1) },
    checkboxInverted: {
        color: `${palette.white.main}`,
    },
    disabled: { color: `${palette.grey[50]} !important` },
});
